window.bookSummaryJSON = "<p>Perfect. <br> Privileged. <br> Strong. <br> Spoiled. <br> Uptight. <br> Useless. </p> <p>If there’s any one thing Pierre and Logan have in common, it’s their ability to invite snap judgements based on shallow views of who they are. </p> <p>Logan is the privileged only daughter of a respected family whose legacy runs long and deep. <br> Pierre is the moody, orphaned son of big screen royalty who couldn’t possibly live up to the prestige of his pedigree. </p> <p>Or maybe not. </p> <p>Perhaps they’re just two people trying to navigate the pressures of a world hellbent on telling them what they should be, and eschewing the limits of other people’s expectations. </p> <p>Maybe what they need most is somebody who can see beyond the shallow first impressions - just one person they can allow to see behind the scenes of who they are. </p> <p>Maybe they have more in common than it seems.</p>"; 
